import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const navigate = useNavigate();

  return (
    <div className="flex items-center justify-center min-h-screen bg-gradient-to-r from-yellow-100 via-yellow-200 to-yellow-300">
      <div className="w-full max-w-md p-8 space-y-6 bg-white rounded shadow-lg text-center">
        <h2 className="text-3xl font-bold text-gray-700">Welcome!</h2>
        <p className="text-gray-600">Choose an option below:</p>
        <div className="space-y-4">
          <button
            onClick={() => navigate('/search')}
            className="w-full py-2 text-white bg-yellow-500 rounded hover:bg-yellow-600 focus:ring-4 focus:ring-yellow-400 focus:ring-opacity-50"
          >
            Search HTTP Codes
          </button>
          <button
            onClick={() => navigate('/lists')}
            className="w-full py-2 text-white bg-yellow-500 rounded hover:bg-yellow-600 focus:ring-4 focus:ring-yellow-400 focus:ring-opacity-50"
          >
            View Saved Lists
          </button>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
